INSERT INTO `faq` (`id`, `title`, `description`, `faq_order`, `status`) VALUES
(3, 'Can anyone Sue/create a case?', 'Yes. But you need to have a membership plans.\r\n', 1, '1'),
(4, 'Will I get updates on my open case(s) if I stop being a member?', 'No. Only members get updates.\r\n', 10, '1'),
(5, 'Is there a Limit to the amount of cases I can create?', 'Yes. The amount of cases you can create depends on your plan.\r\n', 2, '1'),
(6, 'Can I record evidences without a plan?', 'Yes you can record evidences without a plan.\r\n', 3, '1'),
(7, 'Can I share evidences without a plan?', 'No. You need a plan to share evidences', 3, '1'),
(8, 'Can I sue individuals and corporations?', 'Yes. But that depends on your plan.\r\n', 5, '1'),
(9, 'Can I make money from sharing evidences?', ' Yes. You can set the price for sharing your evidence with another user.\r\n', 6, '1'),
(10, 'Do I get money from won cases?', ' If there is an agreed settlement on the case.\r\n', 7, '1'),
(11, 'Does my plan cover drafting?', 'No. Drafting has to be ordered separately using other services on the APP.\r\n', 9, '1'),
(12, 'Does my plan cover court representation?', 'Your court represents may be discounted depending on your plan.\r\n', 8, '1'),
(13, 'Will I get compensation on my closed case(s) if I stop being a member?', 'It depends, if compensation is paid on a case after you excite your plan, 247Sue will deduct standard legal fees from the compensation before pay out.\r\n', 11, '1'),
(14, 'Can I open a case on behave of someone else?', 'No, you can only create a case for yourself.\r\n', 12, '1'),
(15, 'When do I get my compensation?', 'No Longer than 7 days after 247Tech Receives Payment.', 13, '1');
INSERT INTO `how_it_work` (`id`, `icon`, `title`, `description`, `order`, `status`) VALUES
(3, 'flaticon-auction', 'Your evidences are safe', 'you do not have to worry about your evidences getting lost with your device as evidences are saved directly to the cloud and not on your phone.\r\n', 2, '1'),
(4, 'flaticon-family', 'Make money while looking out for each other', 'Protect each other while making money. Record injustices and share evidences with victims to make their cases. The amount you get for your evidence is up to you. All you need is the phone number(s) of the Victim(s).\r\n', 1, '1'),
(5, 'flaticon-house', 'Access to Thousands of Lawyers', 'We understand many people cannot access a lawyer or afford one. As a 247Sue member however, thousands of lawyers are only a few click away. ', 3, '1'),
(6, 'flaticon-shield', 'Create cases and exercise your right', 'For many years you have taken a lot of injustice because you do not know how to go about exercising your right. But not any more. Sue individuals, corporations and government entities from your phone with just a few clicks. Hold your society accountable and earn money doing so.\r\n', 4, '1'),
(7, 'flaticon-handcuffs', 'None Doctorable Video Evidences', 'As video evidences cannot be uploaded unto the app and recorded evidence cannot be edited by users or member, video evidences cannot be doctored.', 5, '1'),
(8, 'fa fa-balance-scale', 'Creating a Case', 'Creating a Case is easy, provide details of the individual or organisation you want to sue, add a brief description of the case, the app already records the location and time of the event. Just attach your evidence and create case. A lawyer will be assigned to your case as quickly as possible.\r\n', 7, '1'),
(9, 'fa fa-users', 'How Lawyers Are assigned to your Case', 'Once your case is created, the nearest lawyer is automatically assigned to your case. If the case is not suitable for your assigned lawyer, a lawyer will be reassigned. \r\n', 8, '1');
