INSERT INTO `team` (`id`, `name`, `designation`, `description`, `profile`, `user_order`, `status`) VALUES
(3, 'Franklin Aliuna Esq', 'Head of Operations - Northern Nigeria', '“ Is legal\r\n										practitioner and a Notary Public of Nigeria with well over 10 years practice\r\n										experience in different practice areas of Law such as commercial, intellectual\r\n										property, civil, Criminal Law practice and ADR. He is the Principal Partner of\r\n										Lofty Heights Solicitors, a service Law Firm based in Abuja Nigeria. He has\r\n										worked for and represented various public/private organisations and individuals.\r\n										He is a member of the Nigeria Bar Association, a Fellow of the Institute of\r\n										Corporate and Public Administrators of Nigeria and a member of other\r\n										professional organisations. ”', 'Franklin.jpg', 1, '1'),
(5, 'Caleb Emiehwe', 'CEO and founder', '“With a BSC in Physics and an MSc in Engineering, I have worked for more\r\n										than 12 years managing complex and highly capital intensive projects in Energy,\r\n										Transport and Aviation sectors in the United Kingdom, Germany and The\r\n										Netherlands. Since 2016, when I founded 247Tech UG, I have been the CEO of this\r\n										amazing start-up focused on proffering Tech solutions for Africa. ”', 'caleb_22.jpg', 2, '1'),
(8, 'Charles Iheme Esq', 'Head of Operations - Southern Nigeria', '“ Is legal\r\n										practitioner with over a decade experience in various aspects of Law including\r\n										but not limited to Commercial, Civil, Criminal Law, Maritime, Construction and\r\n										ADR. He has advised organisations in the field of Oil & Gas, Mergers &\r\n										Acquisitions, Information Technology, Real Property, Intellectual Property etc.\r\n										He is a member of the Nigerian Bar Association, Chartered Institute of\r\n										Arbitrators (U.K) and other professional organisations.”', 'WhatsApp_Image_2023-04-03_at_22_38_56.jpg', 3, '1'),
(9, 'Gift P. Opara (Esq.)', 'Head of Sales and Marketing', 'Gift P. Opara (Esq.) is undergoing a master of  Law Degree (LL.M) in Cyber Law from the University of Lagos, in addition to his Law Degree. He founded P-Tech Legal Practitioners in 2022, after nearly half a decade practicing as an in-house counsel in one of the leading multinational companies and serving as a co-partner cum Head of Corporate for 3years. He draws on that experience to offer Legal and Corporate Governance for existing/emerging Companies; small and medium enterprises through out the Nigeria representation regarding a variety of matters from pre-incorporation through all phases of post incorporation, including debt recovery litigation, merger and acquisition as well as Cyber tort, Data Protection and Cyber Security.', 'Gift2.jpg', 5, '1');
